import React, { useState } from "react";
import DatePicker from 'react-datepicker';
import bike from '../assets/home/book_bike.png';
import clock from '../assets/home/icons/icons_tours/clock.png';



export default function BookBike  ()  {
const [startDate, setStartDate] = useState(new Date());
const [time,setTime] = useState(new Time());
// const [value,onChange]= useState('');


    return(
<section className="booking">
    <section>
        <h4>Book Now Bike</h4>
<section className="bookSet">

 

{/* <section className="general"> */}
       
            <section className="book_set">
            <lable/>Name and Surname
            <input placeholder="Enter your name and surname"/>
      

       <section className="book_set"> 
            <lable/>Email Address
            <input placeholder="Enter your email address"/>
        </section>
        </section>
     
            
        <section className="book_set">
            <lable/>Telephone number
            <input placeholder="Enter your phone number"/>
        </section>

        <section className="book_set">
            <lable/>Service Type
            <input placeholder="Select the service type"/>
       </section>

        <section className="book_set">
            <lable/>Date
            <section className="date-picker">
                <DatePicker 
                    selected={startDate}
                    onChange={(date)=>setStartDate(date)}
                    dateFormat="dd/MM/yyyy"
                    placeholder="Select the date"
                /> 
            </section>
        </section>

        <section className="book_set">
            <label/>Time
            <input
            type="time"
            onChange={(time)=> setTime(time)}
            min="1:00 am"
            />
        </section> 
</section>
      
      
<section className="general">

</section>  
 

      <input type="submit"
   placeholder="Book Now"
    />
</section> 
            </section>
           
// {/* <img src={bike} alt="Book Bike Now"/> */}
// </section>
        
    );
}
